$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_83384dc9945fdf9ada6d6b9428ee2c75'] = 'Indeed, when your customer places an order on your e-shop, he pays the price for sending a parcel only. When you send the order and use the multi-parcel, the quotation will be based on several parcels this time. It is then possible that the price you pay is higher or lower than the price paid by the buyer. Be aware before using the multi-parcel.';
$_MODULE['<{envoimoinscher}prestashop>getcontenthelp_921d6c3ad23f8820e762422c7ddc21cb'] = 'An issued slip is charged, whether used or not. (for instance, 2 slips for 1 parcel in the end = 2 issued slips).';
